import React from "react";
import "./TodoInsert.css";
import { MdAddCircle } from "react-icons/md";
const TodoInsert = ({ onInsertToggle }) => {
  return (
    <>
      <div className="background" onClick={onInsertToggle}>
        background
        <form>
          <input></input>
          <button type="submit">
            <MdAddCircle />
          </button>
        </form>
      </div>
    </>
  );
};

export default TodoInsert;
